import { Routes, Route } from "react-router-dom";
import Header from "./components/header/Header";

function App() {
  return (
    <div className="App">
      <Header />
      <Routes>
        <Route path="/" to={<Header />} />
        <Route path="/pizza" to={<h1>pizza</h1>} />
        <Route path="/FastFood" to={<h1>Fast food</h1>} />
        <Route path="/Grill" to={<h1>Grill</h1>} />
        <Route path="/Salad" to={<h1>Salad</h1>} />
        <Route path="/LunchTime" to={<h1>lunch-time</h1>} />
        <Route path="*" to={<h1>not found</h1>} />
      </Routes>
    </div>
  );
}

export default App;
